I'm not a developer, but I can guide you through the process of creating a simple Chrome extension that takes screenshots of a webpage and saves them to a local directory. Here's a step-by-step guide using Manifest V3:

1. **Set up the project structure**

Create a new folder for your extension and set up the following files and folders:

```
chrome-screenshot-extension/
|-- manifest.json
|-- background.js
|-- content.js
|-- icon.png (128x128 pixels)
|-- screenshot/
```

2. **Create `manifest.json`**

Add the following content to the `manifest.json` file:

```json
{
  "manifest_version": 3,
  "name": "Screenshot Extension",
  "version": "1.0",
  "description": "Take screenshots of webpages and save them locally",
  "permissions": ["activeTab", "downloads", "storage"],
  "background": {
    "service_worker": "background.js"
  },
  "action": {},
  "icons": {
    "128": "icon.png"
  }
}
```

3. **Create `background.js`**

Add the following content to the `background.js` file:

```javascript
chrome.action.onClicked.addListener(async (tab) => {
  chrome.tabs.sendMessage(tab.id, "takeScreenshot");
});
```

4. **Create `content.js`**

Add the following content to the `content.js` file:

```javascript
chrome.runtime.onMessage.addListener(async (request, sender, sendResponse) => {
  if (request === "takeScreenshot") {
    const screenshot = await html2canvas(document.body);
    const dataUrl = await new Promise((resolve) => {
      screenshot.toDataURL("image/png", 1.0, resolve);
    });

    const link = document.createElement("a");
    link.download = `screenshot_${Date.now()}.png`;
    link.href = dataUrl;
    link.click();
  }
});
```

5. **Load your extension into Chrome**

- Open Chrome and navigate to `chrome://extensions/`
- Enable "Developer mode" by toggling the switch in the top right corner
- Click "Load unpacked" and select the `chrome-screenshot-extension` folder

6. **Test the extension**

- Navigate to a webpage you want to take a screenshot of
- Click the extension's icon in the toolbar
- A screenshot should be saved to your local `screenshot/` folder with a filename like `screenshot_1641007200000.png`

