I am trying to create a currency converter app for shopify. I have been looking for a currency conversion api but I can't find any. I have found a few but they are not free. Is there a free currency conversion api that I can use?

## Answer (0)

You can use the Shopify API to get the current currency of the store. You can then use this to convert the price of the product to the desired currency.

Here is an example of how you can do this:

```
const shopify = require('shopify-api-node');

const shopifyApi = new shopify({
  shopName: 'your-shop-name',
  accessToken: 'your-access-token',
  apiVersion: '2022-01',
});

shopifyApi.shop.get().then((shop) => {
  const currentCurrency = shop.currency;
  const product = shopifyApi.product.get('product-id');
  const price = product.price;
  const convertedPrice = price * currentCurrency;
  console.log(convertedPrice);
});
```

You can then use a currency conversion API like the one provided by the European Central Bank to convert the price to the desired currency.

Here is an example of how you can do this:

```
const axios = require('axios');

const convertCurrency = async (amount, fromCurrency, toCurrency) => {
  const response = await axios.get(
    `https://api.exchangerate-api.com/v4/latest/${fromCurrency}`
  );
  const rate = response.data.rates[toCurrency];
  return amount * rate;
};

const convertedPrice = await convertCurrency(
  price,
  currentCurrency,
  'USD'
);
console.log(convertedPrice);
```

You can then use the converted price in your app.

