You can use a `HashMap` to map the choices to the actions, so you don't have to change the code if you add or remove choices. Here's an example:

```
import java.util.HashMap;
import java.util.Scanner;

public class Main {
    public static void main(String[] args) {
        Scanner scanner = new Scanner(System.in);
        HashMap<Integer, Runnable> choices = new HashMap<>();
        choices.put(1, () -> System.out.println("You went north."));
        choices.put(2, () -> System.out.println("You went east."));
        System.out.println("You see a door to the north and a door to the east.");
        System.out.println("Which door do you want to go through?");
        System.out.println("1. North");
        System.out.println("2. East");
        int choice = scanner.nextInt();
        if (choices.containsKey(choice)) {
            choices.get(choice).run();
        } else {
            System.out.println("Invalid choice.");
        }
    }
}
```

This way, you can add or remove choices without changing the code that handles the user's input. You can also use lambdas
